import axios from 'axios'

/*
* 发送请求获取成绩数据*/
var result = {};

export default function request(studentID, studentPassword){
  axios({
    method: 'post',
    datatype: 'json',
    url: 'http://localhost:1323/test',
    data: {
      Sid: studentID,
      Pwd: studentPassword,
    }
  }).then(function (response) {
      console.log(response.data);
      result = response.data;
      })
      .catch(function (error) {
        console.log(error);
      });
  console.log(result);
  return(
    result
  );
};
